+ (void)drawProgressIndicatorViewWithPercentShown: (CGFloat)percentShown;
{
    //// Color Declarations
    NSColor* progressIndicatorTrackColor = [NSColor colorWithCalibratedRed: 0 green: 0 blue: 0 alpha: 0.5];

    //// Variable Declarations
    CGFloat progressWidth = 240 * (percentShown / 100.0);

    //// Track Drawing
    NSBezierPath* trackPath = [NSBezierPath bezierPathWithRect: NSMakeRect(0, 0, 240, 4)];
    [progressIndicatorTrackColor setFill];
    [trackPath fill];


    //// Progress 2 Drawing
    CGFloat progress2CornerRadius = 2;
    NSRect progress2Rect = NSMakeRect(0, 0, progressWidth, 4);
    NSRect progress2InnerRect = NSInsetRect(progress2Rect, progress2CornerRadius, progress2CornerRadius);
    NSBezierPath* progress2Path = NSBezierPath.bezierPath;
    [progress2Path moveToPoint: NSMakePoint(NSMinX(progress2Rect), NSMinY(progress2Rect))];
    [progress2Path appendBezierPathWithArcWithCenter: NSMakePoint(NSMaxX(progress2InnerRect), NSMinY(progress2InnerRect)) radius: progress2CornerRadius startAngle: 270 endAngle: 360];
    [progress2Path appendBezierPathWithArcWithCenter: NSMakePoint(NSMaxX(progress2InnerRect), NSMaxY(progress2InnerRect)) radius: progress2CornerRadius startAngle: 0 endAngle: 90];
    [progress2Path lineToPoint: NSMakePoint(NSMinX(progress2Rect), NSMaxY(progress2Rect))];
    [progress2Path closePath];
    [StreamCloudStyles.orangeGradient drawInBezierPath: progress2Path angle: 90];
}

+ (void)drawProgressSliderKnobWithFrame: (NSRect)frame;
{
    //// Color Declarations
    NSColor* progressSliderKnobStrokeColor = [StreamCloudStyles.grayDark colorWithAlphaComponent: 0.33];
    NSColor* progressSliderKnobColor = [NSColor colorWithCalibratedRed: 1 green: 1 blue: 1 alpha: 1];

    //// Oval Drawing
    NSBezierPath* ovalPath = [NSBezierPath bezierPathWithOvalInRect: NSMakeRect(NSMinX(frame) + 3, NSMinY(frame) + 3, NSWidth(frame) - 6, NSHeight(frame) - 6)];
    [progressSliderKnobColor setFill];
    [ovalPath fill];
    [progressSliderKnobStrokeColor setStroke];
    [ovalPath setLineWidth: 0.5];
    [ovalPath stroke];
}

