    NSImage* imageOfImageOverlayGradientView = [NSImage.alloc initWithSize: NSMakeSize(320, 320)];
    [imageOfImageOverlayGradientView lockFocus];
    [StreamCloudStyles drawImageOverlayGradientViewWithFrame: frame];
    [imageOfImageOverlayGradientView unlockFocus];

    return imageOfImageOverlayGradientView;
}

+ (NSImage*)imageOfSoundCloudLogoWithFrame: (NSRect)frame;
{
    NSImage* imageOfSoundCloudLogo = [NSImage.alloc initWithSize: NSMakeSize(40, 18)];
    [imageOfSoundCloudLogo lockFocus];
    [StreamCloudStyles drawSoundCloudLogoWithFrame: frame];
    [imageOfSoundCloudLogo unlockFocus];

    return imageOfSoundCloudLogo;
}

+ (NSImage*)imageOfMenuBarIconWithActive: (BOOL)active;
{
    NSImage* imageOfMenuBarIcon = [NSImage.alloc initWithSize: NSMakeSize(26, 20)];
    [imageOfMenuBarIcon lockFocus];
    [StreamCloudStyles drawMenuBarIconWithActive: active];
    [imageOfMenuBarIcon unlockFocus];

    return imageOfMenuBarIcon;
}

@end
